import React from 'react';

const MySvgComponent = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 100 100"
      width="100"
      height="100"
    >
      {/* Circle for the head */}
      <circle cx="50" cy="35" r="20" fill="#FFD700" stroke="#333" strokeWidth="2" />

      {/* Semi-circle for the shoulders */}
      <path
        d="M 30 65 Q 50 80 70 65"
        fill="#FFD700"
        stroke="#333"
        strokeWidth="2"
      />

      {/* Ellipse for the body */}
      <ellipse cx="50" cy="80" rx="30" ry="15" fill="#FFD700" stroke="#333" strokeWidth="2" />
    </svg>
  );
};

export default MySvgComponent;
